import React, { Component } from "react";
import axios from "axios";

const axiosInstance = axios.create({
  baseURL: "https://pro-api.coinmarketcap.com/v1/cryptocurrency/",
  timeout: 10000,
  headers: {
    "Accept": "application/json",
    "X-CMC_PRO_API_KEY": "80415b01-6c5a-4547-b5d0-f80814428492"
  }
});

// ICI Create a Class for web services ? Refactor
function getCryptoByMarketcap() {
  axiosInstance
    .get("/listings/latest?start=1&limit=1&convert=USD,BTC")
    .then(response => {
      console.log(response);
    })
    .catch(error => {
      console.log(error);
    });
}

export default getCryptoByMarketcap;
